import React from 'react';
import { Link,Route} from 'react-router-dom'

const Home = () => {
  return (
    <h1>Home</h1>
  );
}
const About = () => {
  return (
    <h1>About</h1>
  );
}

const App = () => {
  return (
    <div>
      <Link to = '/'>Home</Link>
      <Link to = '/about'>About</Link>
      <Route exact path='/' component={Home} />
      <Route path='/about' component={About} />
    </div>
  );
}

export default App;
